//
//         // make and configure a mocked EventsGetter
//         mockedEventsGetter := &EventsGetterMock{
//             EventsFunc: func(namespace string) v1a.EventInterface {
// 	               panic("mock out the Events method")
//             },
//         }
//
//         // use mockedEventsGetter in code that requires EventsGetter
//         // and then make assertions.
//
//     }
type EventsGetterMock struct {
	// EventsFunc mocks the Events method.
	EventsFunc func(namespace string) v1a.EventInterface

	// calls tracks calls to the methods.
	calls struct {
		// Events holds details about calls to the Events method.
		Events []struct {
			// Namespace is the namespace argument value.
			Namespace string
		}
	}
}

// Events calls EventsFunc.
func (mock *EventsGetterMock) Events(namespace string) v1a.EventInterface {
	if mock.EventsFunc == nil {
		panic("EventsGetterMock.EventsFunc: method is nil but EventsGetter.Events was just called")
	}
	callInfo := struct {
		Namespace string
	}{
		Namespace: namespace,
	}
	lockEventsGetterMockEvents.Lock()
	mock.calls.Events = append(mock.calls.Events, callInfo)
	lockEventsGetterMockEvents.Unlock()
	return mock.EventsFunc(namespace)
}

// EventsCalls gets all the calls that were made to Events.
// Check the length with:
//     len(mockedEventsGetter.EventsCalls())
func (mock *EventsGetterMock) EventsCalls() []struct {
	Namespace string
} {
	var calls []struct {
		Namespace string
	}
	lockEventsGetterMockEvents.RLock()
	calls = mock.calls.Events
	lockEventsGetterMockEvents.RUnlock()
	return calls
}
